    const navigate=new useNavigate();
    const [name,setName]=useState("");
    const [password,setPassword]=useState("");
    const [formData,setformData]=useState(
        {
            name:"",
            password:""
        }
        
    )
    const nameChangeHandler=(e)=>{
        setName(e.target.value);
    }
    const passwordChangeHandler=(e)=>{
        setPassword(e.target.value);
    }
    const submitHandler=()=>{
       // alert(password);
       navigate("/home")
        console.log(""+name+" "+password);
    }
    return(
    <div>           
        <div className="container">  
            <h1 className="top-items">Sign Up</h1>
            <h2 className="top-items">Authenticator</h2>
            <form onSubmit={submitHandler}>
                <label for="name" className="startitems">Enter your Name </label>
                <input onChange={nameChangeHandler} value={name} type="text" id="name"/>
                <label for="passkey" className="startitems">Enter Password: </label>
                <input onChange={passwordChangeHandler} value={password} type="password" id="passkey"/>
                <button type="submit">Submit</button>
           </form>
        </div>
    
    </div>)
}

export default Signup
